import React from 'react';
import NavBardentro from '../components/repetidos/NavBardentro.jsx';
import Fotoperfil from '../components/Admin_Perfil/Perfil.jsx'
import Cardperfil from '../components/AD'
import Footer from '../components/repetidos/Footer.jsx';



class PerfilAdmin extends React.Component {
    render() {
        return (
            <div>
                <div>
                    <NavBardentro/>
                </div>
                <div>
                    <Fotoperfil/>
                </div>
                <div>
                    <Footer/>
                </div>
            </div>

        )
    }
}
export default PerfilAdmin;
